import React from "react";

const EditPassword = () => {
  return (
    <div>
      {
        <div>
          <label>目前密碼:</label>
          <input type="password" />
          <label>新密碼:</label>
          <input type="password" />
          <label>確認新密碼:</label>
          <input type="password" />
        </div>
      }
    </div>
  );
};

export default EditPassword;
